ormed some monkey actions." }, "IosAppInfo": { "description": "iOS app information", "type": "object", "id": "IosAppInfo", "properties": { "name": { "type": "string", "description": "The name of the app. Required" } } }, "FailedToInstall": { "properties": {}, "description": "Failed to install the APK.", "type": "object", "id": "FailedToInstall" }, "IosXcTest": { "description": "A test of an iOS application that uses the XCTest framework.", "type": "object", "properties": { "xcodeVersion": { "description": "Xcode version that the test was run with.", "type": "string" }, "bundleId": { "description": "Bundle ID of the app.", "type": "string" } }, "id": "IosXcTest" }, "Outcome": { "id": "Outcome", "properties": { "summary": { "enumDescriptions": [ "Do not use. For proto versioning only.", "The test matrix run was successful, for instance: - All the test cases passed. - Robo did not detect a crash of the application under test.", "A run failed, for instance: - One or more test case failed. - A test timed out. - The application under test crashed.", "Something unexpected happened. The run should still be considered unsuccessful but this is likely a transient problem and re-running the test might be successful.", "All tests were skipped, for instance: - All device configurations were incompatible.", "A group of steps that were run with the same configuration had both failure and success outcomes." ], "type": "string", "description": "The simplest way to interpret a result. Required", "enum": [ "unset", "success", "failure", "inconclusive", "skipped", "flaky" ] }, "inconclusiveDetail": { "$ref": "InconclusiveDetail", "description": "More information about an INCONCLUSIVE outcome. Returns INVALID_ARGUMENT if this field is set but the summary is not INCONCLUSIVE. Optional" }, "skippedDetail": { "description": "More information about a SKIPPED outcome. Returns INVALID_ARGUMENT if this field is set but the summary is not SKIPPED. Optional", "$ref": "SkippedDetail" }, "successDetail": { "$ref": "SuccessDetail", "description": "More information about a SUCCESS outcome. Returns INVALID_ARGUMENT if this field is set but the summary is not SUCCESS. Optional" }, "failureDetail": { "$ref": "FailureDetail", "description": "More information about a FAILURE outcome. Returns INVALID_ARGUMENT if this field is set but the summary is not FAILURE. Optional" } }, "description": "Interprets a result so that humans and machines can act on it.", "type": "object" }, "InconclusiveDetail": { "type": "object", "description": "Details for an outcome with an INCONCLUSIVE outcome summary.", "id": "InconclusiveDetail", "properties": { "abortedByUser": { "type": "boolean", "description": "If the end user aborted the test execution before a pass or fail could be determined. For example, the user pressed ctrl-c which sent a kill signal to the test runner while the test was running." }, "infrastructureFailure": { "type": "boolean", "description": "If the test runner could not determine success or failure because the test depends on a component other than the system under test which failed. For example, a mobile test requires provisioning a device where the test executes, and that provisioning can fail." }, "hasErrorLogs": { "type": "boolean", "description": "If results are being provided to the user in certain cases of infrastructure failures" } } }, "StepLabelsEntry": { "type": "object", "id": "StepLabelsEntry", "properties": { "value": { "type": "string" }, "key": { "type": "string" } } }, "SafeHtmlProto": { "type": "object", "description": "IMPORTANT: It is unsafe to accept this message from an untrusted source, since it's trivial for an attacker to forge serialized messages that don't fulfill the type's safety contract -- for example, it could contain attacker controlled script. A system which receives a SafeHtmlProto implicitly trusts the producer of the SafeHtmlProto. So, it's generally safe to return this message in RPC responses, but generally unsafe to accept 